import React, { Component } from 'react'

export class Dashboard extends Component {
    constructor(){
        super()
        this.state={
            user: 'swap'
        }

        //this.set_user = this.set_user.bind(this)
    }

    /*set_user = () =>{
        this.setlocalStorage.getItem('username')
    }*/

    render() {
        const isLoggedIn = localStorage.getItem('logged_in');
        return (
            <div>
                {isLoggedIn ? (
                     <img src={'../../PROFILE/' + this.state.user} 
                     onError={(e)=>{e.target.onerror = null; e.target.src="../../PROFILE/def.jpg"}}
                     alt="Not Found" /> 
                ) : (
                    this.props.history.push('/')
                )}
            </div>
        )
    }
}

export default Dashboard
